def bfs(graph, start, end):
    queue = [[start]]
    visited = set()
    while queue:
        path = queue.pop(0)
        node = path[-1]
        if node in visited:
            continue
        for adjacent in range(len(graph[node])):
            if graph[node][adjacent] == 1 and adjacent not in visited:
                new_path = list(path)
                new_path.append(adjacent)
                if adjacent == end:
                    return new_path
                queue.append(new_path)
        visited.add(node)
    return None

