def clean_rows(grid):
    n = len(grid)
    dp = [[0] * n for _ in range(n)]
    for i in range(n):
        for j in range(n):
            if grid[j][i] == '1':
                dp[j][i] = 1
            else:
                dp[j][i] = min(dp[j][k] + 1 for k in range(i))
    return max(sum(row) for row in zip(*dp))

