def shortest_path(n, graph, v, w):
    visited = [False] * n
    dist = [float('inf')] * n
    dist[v] = 0

    for _ in range(n - 1):
        min_dist = float('inf')
        u = -1
        for i in range(n):
            if not visited[i] and dist[i] < min_dist:
                min_dist = dist[i]
                u = i

        visited[u] = True
        for k in range(n):
            if graph[u][k] != 0 and not visited[k]:
                new_dist = dist[u] + graph[u][k]
                if new_dist < dist[k]:
                    dist[k] = new_dist

    if dist[w] == float('inf'):
        return "NO"
    else:
        return dist[w]

