            if (x + s - 1) // s > time:
                return False
            if current_sum + x > time * s:
                count += 1
                current_sum = 0
            current_sum += x
        return count <= k

    left = max((x+s-1)//s for x in p)
    right = sum(p)
    ans = right

    while left <= right:
        mid = (left + right) // 2
        if check(mid):
            ans = mid
            right = mid - 1
        else:
            left = mid + 1

    print(ans)

