def max_square_area(n, disk):
    max_area = 0
    for i in range(1, n):
        for j in range(i, n):
            area = i * j
            square = [[disk[y][x] for y in range(n - i)] for x in range(n - j)]
            count = 0
            for row in square:
                if all(x == row[0] for x in row):
                    count += area
            max_area = max(max_area, count)
    return max_area

