def is_euler_cycle_possible(graph):
    n = len(graph)
    degrees = [0] * n

    for i in range(n):
        for j in range(n):
            if graph[i][j] == 1:
                degrees[i] += 1
                degrees[j] += 1

    for degree in degrees:
        if degree % 2 != 0:
            return False

    return True


