def robot_artist_time(path):
    visited = set()
    x, y = 0, 0
    time = 0

    for move in path:
        if move == 'U':
            y += 1
        elif move == 'D':
            y -= 1
        elif move == 'L':
            x -= 1
        elif move == 'R':
            x += 1

        if (x, y) in visited:
            time += 1
        else:
            time += 5
            visited.add((x, y))

    return time

