def min_time_to_eat_candies(n, k, s, bags):
    def can_finish_in_time(mid):
        total_time = 0
        for i in range(n):
            total_time += (bags[i] + s - 1) // s
        return total_time <= k * mid

    left, right = 1, sum((bag + s - 1) // s for bag in bags)
    while left < right:
        mid = (left + right) // 2
        if can_finish_in_time(mid):
            right = mid
        else:
            left = mid + 1
    return left

